pragma solidity ^0.4.21;

import "zeppelin-solidity/contracts/token/ERC721/ERC721Token.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";

contract ERC20Interface {
  function totalSupply() public constant returns (uint);
  function balanceOf(address tokenOwner) public constant returns (uint balance);
  function allowance(address tokenOwner, address spender) public constant returns (uint remaining);
  function transfer(address to, uint tokens) public returns (bool success);
  function approve(address spender, uint tokens) public returns (bool success);
  function transferFrom(address from, address to, uint tokens) public returns (bool success);
  event Transfer(address indexed from, address indexed to, uint tokens);
  event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
}

contract TTTSan is ERC721Token, Ownable {

  address public wallet = 0xC5fdf4076b8F3A5357c5E395ab970B5B54098Fef;
  address public tttTokenAddress = 0x623ecfb8405643e761967b4f87d300c499d45d29;

  uint decimals = 18;

  mapping(string=>uint) sanOwnership;

  struct SAN {
    string sanName;
  }

  SAN[] sanNames;

  function TTTSan() ERC721Token("TTTSAN", "TTTS") {}

  function setTokenAddress(address _tokenAddress) external onlyOwner {
    require(tttTokenAddress == 0x0);
    tttTokenAddress = _tokenAddress;
  }

  function sanMint(address _to, string _sanName, uint256 _tip) external {
    assert(_tip > 4);
    assert(sanOwnership[_sanName] == 0);
    sanOwnership[_sanName] = 1;
    ERC20Interface(tttTokenAddress).transfer(wallet, numToWei(_tip, decimals));
    SAN memory san = SAN({sanName: _sanName});
    uint sanId = sanNames.push(san) - 1;
    _mint(_to, sanId);
  }

  function getSan(uint _sanId) public view returns(string sanName) {
    return sanNames[_sanId].sanName;
  }

  function numToWei(uint256 _num, uint _decimals) internal pure returns (uint256 w) {
		return _num.mul(10**_decimals);
	}
}
